import React, { Component } from 'react'
import {Link} from 'react-router-dom'
import PropTypes from 'prop-types'

export class loginForm extends Component {
    static propTypes = {

    }

    render() {
        return (
            <div className="center">
            <hr/>
            <input className="formCenter" type="text" id="username" placeholder="Username"></input>
            <br/>
            <input className="formCenter" type="password" id="password" placeholder="Password"></input>
            <hr/>
            <button className ="formCenter"  id="loginButton"> Login </button>
            <br/>
            <Link className="formCenter" to ="/signup"> Sign Up </Link>
            <br/>
            <Link className="formCenter" to ="/forgatpass"> Forgat Password </Link>
        </div>
        )
    }
}

export default loginForm
